import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import {
  Grid,
  Card,
  CardContent,
  Typography,
  CircularProgress,
  Box,
  Paper,
  Divider,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  Button
} from '@mui/material';
import { PieChart, Pie, Cell, ResponsiveContainer, BarChart, Bar, XAxis, YAxis, Tooltip } from 'recharts';

function Dashboard() {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    console.log('Dashboard: Starting data fetch');

    // Fetch stats from API
    fetch('/api/stats')
      .then(response => {
        console.log('Stats API response:', response.status);
        if (!response.ok) {
          throw new Error(`API returned ${response.status}: ${response.statusText}`);
        }
        return response.json();
      })
      .then(data => {
        console.log('Stats data received:', data);
        if (!data) {
          throw new Error('No data received from API');
        }
        setStats(data);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching stats:', error);
        setError('Failed to load stats data: ' + error.message);
        setLoading(false);
      });

    // Also fetch servers to get the actual count
    fetch('/api/servers')
      .then(response => {
        console.log('Servers API response:', response.status);
        return response.json();
      })
      .then(data => {
        console.log('Servers data received:', data.length, 'servers');
        // Update the server count based on actual data
        setStats(prevStats => {
          if (!prevStats) return { serverCount: data.length };
          return {
            ...prevStats,
            serverCount: data.length
          };
        });
      })
      .catch(error => {
        console.error('Error fetching servers:', error);
      });
  }, []);

  // Debug render
  console.log('Dashboard rendering with stats:', stats, 'loading:', loading, 'error:', error);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ mt: 4 }}>
        <Typography color="error" variant="h6">
          Error: {error}
        </Typography>
      </Box>
    );
  }

  if (!stats) {
    return (
      <Box sx={{ mt: 4 }}>
        <Typography color="error" variant="h6">
          No data available
        </Typography>
      </Box>
    );
  }

  // Prepare data for charts
  const successRateData = [
    { name: 'Success', value: stats.successRate },
    { name: 'Failure', value: 100 - stats.successRate },
  ];

  const regionData = Object.entries(stats.regions || {}).map(([region, count]) => ({
    name: region || 'Unknown',
    count,
  }));

  const COLORS = ['#00C49F', '#FF8042', '#0088FE', '#FFBB28', '#8884d8'];

  return (
    <Box sx={{ 
      backgroundColor: 'background.paper', 
      padding: 2, 
      borderRadius: 1,
      border: '1px solid red' // Temporary to make it visible
    }}>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Servers
              </Typography>
              <Typography variant="h3" color="primary">
                {stats.serverCount}
              </Typography>
              <Typography variant="body2" color="textSecondary">
                <Link to="/servers">View all servers</Link>
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Discoveries
              </Typography>
              <Typography variant="h3" color="primary">
                <Link 
                  to="/discoveries" 
                  style={{ 
                    color: 'inherit', 
                    textDecoration: 'none',
                    '&:hover': {
                      textDecoration: 'underline',
                      color: 'primary.main'
                    }
                  }}
                >
                  {stats.discoveryCount}
                </Link>
              </Typography>
              <Typography variant="body2" color="textSecondary">
                Total discovery operations
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Success Rate
              </Typography>
              <Typography variant="h3" color="primary">
                {stats.successRate.toFixed(1)}%
              </Typography>
              <Typography variant="body2" color="textSecondary">
                Discovery success rate
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, height: 300 }}>
            <Typography variant="h6" gutterBottom>
              Success Rate
            </Typography>
            <ResponsiveContainer width="100%" height="90%">
              <PieChart>
                <Pie
                  data={successRateData}
                  cx="50%"
                  cy="50%"
                  labelLine={false}
                  outerRadius={80}
                  fill="#8884d8"
                  dataKey="value"
                  label={({ name, percent }) => `${name}: ${(percent * 100).toFixed(1)}%`}
                >
                  {successRateData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={index === 0 ? '#00C49F' : '#FF8042'} />
                  ))}
                </Pie>
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, height: 300 }}>
            <Typography variant="h6" gutterBottom>
              Servers by Region
            </Typography>
            <ResponsiveContainer width="100%" height="90%">
              <BarChart data={regionData}>
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Bar dataKey="count" fill="#8884d8">
                  {regionData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                  ))}
                </Bar>
              </BarChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column' }}>
            <Typography component="h2" variant="h6" color="primary" gutterBottom>
              Recent Discoveries
            </Typography>
            <TableContainer component={Paper}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Hostname</TableCell>
                    <TableCell>Port</TableCell>
                    <TableCell>Region</TableCell>
                    <TableCell>OS Type</TableCell>
                    <TableCell>Tags</TableCell>
                    <TableCell>Last Discovery</TableCell>
                    <TableCell>Actions</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {stats.servers.map((server) => (
                    <TableRow key={server.id}>
                      <TableCell>
                        <Link to={`/servers/${server.id}`}>{server.hostname}</Link>
                      </TableCell>
                      <TableCell>{server.port}</TableCell>
                      <TableCell>{server.region}</TableCell>
                      <TableCell>{server.port === 22 ? 'Linux' : 'Windows'}</TableCell>
                      <TableCell>
                        {server.tags && server.tags.map((tag) => (
                          <Chip 
                            key={tag.key} 
                            label={`${tag.key}: ${tag.value}`} 
                            size="small" 
                            sx={{ mr: 0.5, mb: 0.5 }}
                          />
                        ))}
                      </TableCell>
                      <TableCell>
                        {server.last_discovery ? new Date(server.last_discovery).toLocaleString() : 'Never'}
                      </TableCell>
                      <TableCell>
                        <Button 
                          variant="contained" 
                          size="small" 
                          onClick={() => handleRunDiscovery(server.id)}
                          disabled={runningDiscoveries.includes(server.id)}
                        >
                          {runningDiscoveries.includes(server.id) ? 'Running...' : 'Run Discovery'}
                        </Button>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
